import Button from "@material-ui/core/Button";
import {Typography} from "@material-ui/core";
import makeStyles from "@material-ui/core/styles/makeStyles";

const useStyles = makeStyles({
    button : {
        marginTop : 20,
    }
})


const AskQuestion = (props) => {

const classes = useStyles();
    return (
        <div>
            <Typography>Ask a question</Typography>
            <form className="form">
                <input type="text" className="form-input"  placeholder="Enter title"
                    //onChange={event => setTitle({ title : event.target.value})}
                />
                <input type="text" className="form-input"  placeholder="Enter subtitle"
                      // onChange={event => setSubtitle({subtitle : event.target.value})}
                />
                <input type="text" className="form-input"  placeholder="Enter Category"
                      // onChange={event => setQuestion({category : event.target.value})}
                />
                <Button className={classes.button} variant="contained" color="primary"
                    // onClick={addQuestions}
                >Submit
                </Button>
                <Typography component="p"></Typography>
            </form>
        </div>
    )
}

export default AskQuestion;
